        this.getComponent(this.state.count);
    }
    .bind(this),
    5000
);
   }

   getHours=(timeStamp,timezone)=>{


     let unix_timestamp = timeStamp
     var date = new Date(unix_timestamp*1000);
     var diff = Math.floor((timezone / 60)/60);
     let dayMoment = moment(date).utcOffset(timezone).format('h:mm A');
     console.log(dayMoment);
     var currentUtc = date.getUTCHours();

     var localTime=  currentUtc +  diff;

     var hours = currentUtc +  diff;  
     var minutes = "0" + date.getMinutes();
     var seconds = "0" + date.getSeconds();
     var formattedTime = hours + ':' + minutes.substr(-2);
     return formattedTime;
   }

   async getComponent(count){
     let weatherCode=this.state.weatherObject.weather.id;
     let conditionWeather = this.getCondition(weatherCode);
     switch(parseInt(count)) {
      case 1:
        this.setState
        this.setState({
          ActualView:MainModule,
          count:2
         });
        break;
      case 2:
        this.setState({
          ActualView:conditionWeather,
           count:3
         });
        break;
       case 3:
        this.setState({
          ActualView:SolarModule,
           count:4
         });
        break;
         case 4:
        this.setState({
          ActualView:HumidityModule,
           count:1
         });
        break;
      default:
        this.setState({
          ActualView:MainModule,
           count:2
         });
}
   }

   getCondition = (condition) =>{
     let condStr=condition.toString();
     let conditionWeather = condStr == "801" || condStr == "802"  || condStr == "803"  || condStr == "804"  ? 801 : condStr.substring(2,-1);
    switch(parseInt(conditionWeather)) {
      case 20:
        return Condition200;
        break;
      case 30:
        return Condition300;
        break;
       case 50:
        return Condition500;
        break;
        case 60:
        return Condition600;
        break;
         case 80:
        return Condition800;
        break;
         case 803:
        return Condition801;
        break;
      default:
        return Condition200;

   }
 }

 getTemp = (temp)=>{
   let tempInt = parseInt(temp);
   if (tempInt<-10){
       tempInt=-10;
   }else if(tempInt>-10 && tempInt<0){
       tempInt=0;
   }else if(tempInt>0 && tempInt<10){
       tempInt=10;
   }else if(tempInt>10 && tempInt<20){
       tempInt=20;
   }else if(tempInt>20 && tempInt<30){
       tempInt=30;
   }else if(tempInt>30 && tempInt<40){
       tempInt=40;
   }else if(tempInt>40){
       tempInt=50;
   }
   switch(tempInt) {
      case -10:
        return "#300fa9";
        break;
         case 0:
        return "#0e30b7";
        break;
         case 10:
        return "#0e7fb7";
        break;
         case 20:
        return "#0eb7af";
        break;
         case 30:
        return "#e08612";
        break;
         case 40:
        return "#f35b2a";
        break;
         case 50:
        return "#f33f04";
        break;
      default:
        return "#15e2e4";

   }
 }

